import React from 'react'
import { Bar } from 'react-chartjs-2'

const BarChart = () => {
    const data = {
        labels: [
            '1',
            '2',
            '3',
            '4',
            '5',
            '6',
        ],
        datasets: [{
            label: 'My weight graph',
            data: [65, 59, 80, 81, 56, 55, 40],
            backgroundColor: [
                'rgba(255, 99, 132, 0.2)',
                'rgba(255, 159, 64, 0.2)',
                'rgba(255, 205, 86, 0.2)',
                'rgba(75, 192, 192, 0.2)',
                'rgba(54, 162, 235, 0.2)',
                'rgba(153, 102, 255, 0.2)',
                'rgba(201, 203, 207, 0.2)'
            ],
            borderColor: [
                'rgb(255, 99, 132)',
                'rgb(255, 159, 64)',
                'rgb(255, 205, 86)',
                'rgb(75, 192, 192)',
                'rgb(54, 162, 235)',
                'rgb(153, 102, 255)',
                'rgb(201, 203, 207)'
            ],
            borderWidth: 1
        }],
    }
    const options = {
        responsive: true,
        maintainAspectRatio: true,
        defaultFontSize: 13,
        scales: {
          x: {
            grid: {
              drawBorder: false,
              display: false
            },
            title: {
              display: true,
              text: 'Weight'
            }
          },
          y: {
            grid: {
              drawBorder: false,
              display: false
            },
            title: {
              display: true,
              text: 'Days'
            }
          }
        }
      }

    return(
        <>
            <Bar data={data} options={options} style={{margin:"50px 0px 20px 80px",width:"60%"}}/>
        </>
    )
}

export default BarChart
